import React from 'react';


const IdentitySection = ({ firstName, lastName, email, handleInfoChange }) => {
  return (
    <div>
    <input
    name="firstName"
    placeholder="First"
    required
    value={firstName}
    onChange={handleInfoChange()}
    />
    <input
    name="lastName"
    placeholder="Last"
    required
    value={lastName}
    onChange={handleInfoChange}
    />
    <input
    name="email"
    placeholder="email"
    required
    value={email}
    onChange={handleInfoChange}
    />
    </div>
  )
}

export default IdentitySection;
